import React from "react";
import cl from "./style.modal.css";

const CustomAlert = ({ customAlert }) => {
  const rootClasses = [cl.alert];
  if (customAlert) {
    rootClasses.push(cl.active);
  }

  return <div className={rootClasses.join(" ")}>Alert</div>;
};

export default CustomAlert;
